import React, {useState} from 'react'

export const UnsplashImage = () => {
	const [imagesList, setImagesList] = useState([])

	const fetchImagesList = async () => {
		try {
			const response = await fetch(
				'https://api.unsplash.com/photos/?query=nature&client_id=pmTNZxpE0TQ6pRwUqnkTL8uWNhzcEWYQzPdzd8NtmPo')
			const data = await response.json()

			setImageList(data)
		}
		catch {
			console.error("Error fetching images from API, Please try again!")
		}
	}


	return (
		<div>UnsplashImage</div>
	)
}
